import { combineReducers } from "redux";

const initialState = {
    clients:[],
    client: {}
};
    //reducer counter takes past state, action and gives new state
    //never touch this const or aloter it
    const rootReducer = (state = initialState, action) => {
        switch (action.type){
          case '':
            return "";
          case '2' :
            return "";
          default:
            return state;
        }
      };

export default rootReducer;
